Ask Russia/Belarus/China/NK right now, or Nazi Germany in the 1940s.

There can be a discussion when both sides of the conversation have merit. The conservative side has none here.

@PeterDaszak @flodebarre I'm not saying the entire lab leak movement is the product of any one group.

But there's no doubt it's been pushed by people with an agenda, in particular the nexus of the Trumpist American right-wing and overseas Chinese groups.

